import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import 'bootstrap/dist/css/bootstrap.css';
import { BrowserRouter} from "react-router-dom";
import { Provider } from 'react-redux';
import {configureStore} from '@reduxjs/toolkit'
import noteReducer from './features/notes'
import collectionReducer from './features/collection'
import darkModeReducer from './features/darkMode'
import categoryReducer from './features/categoryBar'
import customerDetailsReducer from './features/customerDetails'



const store = configureStore({
  reducer: {
    notes : noteReducer,
    collection: collectionReducer,
    darkMode : darkModeReducer,
    categoryBar:categoryReducer,
    customerDetails : customerDetailsReducer
  },
  middleware: getDefaultMiddleware =>
  getDefaultMiddleware({
    serializableCheck: false,
  }),
})

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
    <Provider store = {store} >

      <App />
    </Provider>


    </BrowserRouter>
  </React.StrictMode>
);
